#[allow(unused_variable)]
fn parse_digit(input: &str, pos: uint) -> Result<(uint, ()) , uint> {
    if input.len() > pos {
        let CharRange {ch, next} = input.char_range_at(pos);
        match ch {
            '0'..'9' => { Ok((next, ())) }
            _ => Err(pos),
        }
    } else {
        Err(pos)
    }
}
