#[allow(unused_variable)]
fn parse___(input: &str, pos: uint) -> Result<(uint, ()) , uint> {
    let mut repeat_pos = pos;
    loop {
        let step_res = {
            let pos = repeat_pos;
            let choice_res = {
                parse_whitespace(input, pos)
            };
            match choice_res {
                Ok((pos, value)) => Ok((pos, value)),
                Err(..) => {
                    let choice_res = {
                        parse_eol(input, pos)
                    };
                    match choice_res {
                        Ok((pos, value)) => Ok((pos, value)),
                        Err(..) => {
                            parse_comment(input, pos)
                        }
                    }
                }
            }
        };
        match step_res {
            Ok((newpos, _)) => {
                repeat_pos = newpos;
            }
            Err(..) => {
                break;
            }
        }
    }
    Ok((repeat_pos, ()))
}
